import axios from "axios"
import { useState } from "react";
import { getapi } from "../constant"

const getResource = ()=>{
  let resp="";  
  // let [d,setD]=useState(null) 
   fetch(getapi)
  .then(response => response.json())
  .then(data => {
      console.log(data);
      resp=data;
      return resp
  });
  console.log(resp)
  return resp;

}
export default getResource;
